import cv2
import numpy as np
from google.colab.patches import cv2_imshow


# Step 1: Load the traffic sign image
image = cv2.imread('traffic light.jpeg')

# Step 2: Convert the image to grayscale
gray = cv2.cvtColor(image, cv2.COLOR_BGR2GRAY)

# Step 3: Apply thresholding to segment the sign
_, thresholded = cv2.threshold(gray, 127, 255, cv2.THRESH_BINARY)

# Step 4: Use edge detection to highlight boundaries
edges = cv2.Canny(thresholded, 50, 150)

# Step 5: Use morphological operations to remove noise
kernel = np.ones((3,3), np.uint8)
processed = cv2.morphologyEx(edges, cv2.MORPH_CLOSE, kernel)

# Step 6: Show the results

cv2_imshow(image)
cv2_imshow(gray)
cv2_imshow(thresholded)
cv2_imshow(edges)
cv2_imshow(processed)
cv2.waitKey(0)
cv2.destroyAllWindows()

"""#Scenario 02:

![image.png](data:image/png;base64,)
"""

import cv2
import numpy as np
from google.colab.patches import cv2_imshow

# Load images
image1 = cv2.imread('satellite.png')
image2 = cv2.imread('task 3.jpeg')

# Check if images are loaded correctly
if image1 is None or image2 is None:
    print("Error: One or both images failed to load. Check file paths!")
else:
    # Resize image2 to match image1's size
    image2 = cv2.resize(image2, (image1.shape[1], image1.shape[0]))

    # Blend images
    blended = cv2.addWeighted(image1, 0.5, image2, 0.5, 0)

    # Convert to grayscale
    gray = cv2.cvtColor(blended, cv2.COLOR_BGR2GRAY)
    _, thresholded = cv2.threshold(gray, 127, 255, cv2.THRESH_BINARY)

    # Edge detection
    edges = cv2.Canny(thresholded, 50, 150)

    # Create mask
    mask = np.zeros_like(image1)
    mask[100:300, 150:350] = 255

    # Apply mask
    highlighted_region = cv2.bitwise_and(blended, blended, mask=mask[:,:,0])

    # Display results (use cv2_imshow in Colab)
    cv2_imshow(blended)
    cv2_imshow(gray)
    cv2_imshow(thresholded)
    cv2_imshow(edges)
    cv2_imshow(highlighted_region)

    cv2.waitKey(0)
    cv2.destroyAllWindows()

"""#Scenario 03:

![image.png](data:image/png;base64,)
"""

import cv2
import numpy as np
from google.colab.patches import cv2_imshow

# Step 1: Load the surveillance image
image = cv2.imread('satellite.png', 0)

# Check if the image is loaded
if image is None:
    print("Error: Image not loaded. Check the file path!")
else:
    # Step 2: Convert the image into a binary mask using thresholding
    _, binary_mask = cv2.threshold(image, 127, 255, cv2.THRESH_BINARY)

    # Step 3: Apply morphological operations to filter noise
    kernel = np.ones((3, 3), np.uint8)
    filtered = cv2.morphologyEx(binary_mask, cv2.MORPH_OPEN, kernel)

    # Step 4: Load two consecutive frames for motion detection
    frame1 = cv2.imread('satellite.png', 0)
    frame2 = cv2.imread('satellite.png', 0)

    if frame1 is None or frame2 is None:
        print("Error: Frames not loaded properly.")
    else:
        # Step 5: Use image subtraction to detect motion
        motion = cv2.absdiff(frame1, frame2)

        # Step 6: Display results using cv2_imshow()
        cv2_imshow(binary_mask)
        cv2_imshow(filtered)
        cv2_imshow(motion)











